import React from 'react';

const DashboardCard = ({ icon: Icon, label, onClick }) => (
  <div 
    onClick={onClick}
    className="bg-white rounded-lg shadow-sm p-8 cursor-pointer hover:shadow-md transition-shadow"
  >
    <div className="flex flex-col items-center">
      <div className="w-16 h-16 bg-rose-100 rounded-full flex items-center justify-center mb-4">
        <Icon className="h-8 w-8 text-rose-600" />
      </div>
      <h3 className="text-xl font-semibold text-gray-900">{label}</h3>
    </div>
  </div>
);

export default DashboardCard;
